"use strict";

;
var element = document.querySelector('.accordion__el');
var elements = document.querySelectorAll('.accordion__el');
var title = document.querySelectorAll('.acc-btn');
element.classList.add('active');
title.forEach(function (item, index, arr) {
  item.onclick = function () {
    var parent = item.parentNode;

    if (parent.classList.contains('active')) {
      parent.classList.remove('active');
    } else {
      /*Удаление active у всех элементов*/
      elements.forEach(function (all) {
        all.classList.remove('active');
      });
      /*Добавление класса*/

      parent.classList.toggle('active');
    }
  };
});
var up = document.getElementsByClassName('parallax_up');
var down = document.getElementsByClassName('parallax_down');
new simpleParallax(up, {
  orientation: 'up',
  scale: 2,
  overflow: true,
  delay: .6,
  transition: 'cubic-bezier(0,0,0,1)'
});
new simpleParallax(down, {
  orientation: 'down',
  scale: 2,
  overflow: true,
  delay: .6,
  transition: 'cubic-bezier(0,0,0,1)'
});
;
media();

window.onresize = function () {
  return media();
};

function media() {
  // options;
  var desktop = true;
  var laptop = false;
  var mediaDesktop = window.matchMedia('(min-width: 1024px)');
  var mediaLaptop = window.matchMedia('(max-width: 1024px)');

  if (mediaDesktop.matches) {
    laptop = false;
    desktop = true;
  }

  if (mediaLaptop.matches) {
    desktop = false;
    laptop = true;
  }

  if (desktop) {
    flkty = null;
  }

  if (laptop) {
    var flkty = new Flickity('.slider');
  }
}

;

function unite() {
  var unite_box = document.querySelector('.unite');
  var acc = document.querySelector('.accordion');
  var rew = document.querySelector('.reviews');
  var acc_h = acc.clientHeight;
  var rew_h = rew.clientHeight;

  if (acc_h > rew_h) {
    rew.style.height = "".concat(acc_h, "px");
    unite_box.style.height = "".concat(acc_h, "px");
  }

  if (acc_h < rew_h) {
    acc.style.height = "".concat(rew_h, "px");
    unite_box.style.height = "".concat(rew_h, "px");
  }
}

setInterval(function () {
  unite();
}, 100);
